import React from 'react';
import { Link } from 'react-router-dom';
import "../index.css";

const UsersPage = () => {
  const getUserEmail = () => {
    return localStorage.getItem('userEmail'); // Retrieve user email from local storage
    // Replace this logic with how you're storing the email after login
  };
  return (
    <div className="page-container">
      <h2 className="page-title">Welcome to the User Management Dashboard</h2>
      <div className="link-container">
        <Link to="/get-users">See All Users</Link>
      </div>
      <div className="link-container">
        <Link to="/get-devices">See All Devices</Link>
      </div>
      <div className="link-container">
        <Link to="/get-devices-of-users">See My Devices</Link>
      </div>
      <div className="link-container">
        <Link to="/start-chat">Chat</Link>
      </div>
    </div>
  );
};

export default UsersPage;
